DROP TABLE IF EXISTS `_balance_history`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `_balance_history` AS select `payment`.`date` AS `date`,'i' AS `transaction_type`,`payment`.`id` AS `transaction_id`,`payment`.`amount` AS `in`,'' AS `out`,if(`payment`.`remark` <> '',concat(`customer`.`name`,' - ',`payment`.`remark`),`customer`.`name`) AS `remark` from (`payment` left join `customer` on(`payment`.`customer_id` = `customer`.`id`)) union select `expense`.`date` AS `date`,'o' AS `transaction_type`,`expense`.`id` AS `transaction_id`,'' AS `in`,`expense`.`amount` AS `out`,if(`expense`.`person_in_charge` <> '',concat(`expense`.`person_in_charge`,' - ',`expense`.`name`),`expense`.`name`) AS `remark` from `expense` union select `capital`.`date` AS `date`,'i' AS `transaction_type`,`capital`.`id` AS `transaction_id`,`capital`.`amount` AS `in`,'' AS `out`,`capital`.`name` AS `remark` from `capital` order by `date`,`transaction_type`;

DROP TABLE IF EXISTS `_debt_history`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `_debt_history` AS select `outgoing`.`customer_id` AS `customer_id`,`outgoing`.`date` AS `date`,`outgoing`.`id` AS `outgoing_id`,`outgoing`.`total` AS `debt`,NULL AS `payment_id`,0 AS `credit`,0 AS `adjustment`,0 AS `return`,`outgoing`.`remark` AS `remark` from `outgoing` union select `payment`.`customer_id` AS `customer_id`,`payment`.`date` AS `date`,NULL AS `NULL`,0 AS `debt`,`payment`.`id` AS `payment_id`,`payment`.`amount` AS `credit`,`payment`.`adjustment` AS `adjustment`,`payment`.`return` AS `return`,`payment`.`remark` AS `remark` from `payment` order by `date`;

DROP TABLE IF EXISTS `_stock_history`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `_stock_history` AS (select `incoming_item`.`id` AS `id`,`incoming_item`.`item_id` AS `item_id`,`incoming`.`date` AS `date`,'i' AS `transaction_type`,`incoming_item`.`incoming_id` AS `transaction_id`,`supplier`.`name` AS `supplier`,'' AS `customer`,`incoming_item`.`quantity` AS `quantity` from ((`incoming_item` join `incoming`) join `supplier`) where `incoming_item`.`incoming_id` = `incoming`.`id` and `incoming`.`supplier_id` = `supplier`.`id`) union (select `outgoing_item`.`id` AS `id`,`outgoing_item`.`item_id` AS `item_id`,`outgoing`.`date` AS `date`,'o' AS `transaction_type`,`outgoing_item`.`outgoing_id` AS `transaction_id`,'' AS `supplier`,`customer`.`name` AS `customer`,`outgoing_item`.`quantity` AS `quantity` from ((`outgoing_item` join `outgoing`) join `customer`) where `outgoing_item`.`outgoing_id` = `outgoing`.`id` and `outgoing`.`customer_id` = `customer`.`id`) order by `date`,`transaction_type`;

DROP TABLE IF EXISTS `_stock_history_daily`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `_stock_history_daily` AS select `_stock_history`.`date` AS `date`,`_stock_history`.`item_id` AS `item_id`,sum(case when `_stock_history`.`transaction_type` = 'i' then `_stock_history`.`quantity` else 0 end) AS `quantity_in`,sum(case when `_stock_history`.`transaction_type` = 'o' then `_stock_history`.`quantity` else 0 end) AS `quantity_out` from `_stock_history` group by `_stock_history`.`item_id`,`_stock_history`.`date` order by `_stock_history`.`date`;

